import React from 'react';
import './AddWork.css'

var description = "";

var AddWorkEvent = (event) => {
    alert(event.target.value);
}

var AddWorkField = (
    <div className="add-work-field">
        <div className="form-group">
            <form>
                <input placeholder="What needs to be done?" className="form-control"></input>
                <button type="button" className="btn btn-primary" onClick={AddWorkEvent}>Add</button>
            </form>
        </div>
    </div>
);

function AddWork() {
    return AddWorkField;
}

export default AddWork;
